import React from "react";
import Header from "./Header.jsx";
import Footer from "./Footer.jsx"
import Note from "./Notes.jsx";
import notes from "../Note.js";

function newNote(){
    return (<Note 
        id = {notes.key}
        key = {notes.key}
        title = {notes.title}
        content = {notes.content}
    />);
}

function App(){
    return <div>
    <Header />

    {notes.map(newNote)}
    
    <Footer />
</div>   
}

export default App;
